records.addlTxt:
02:27 PM Defendant Garry D Hurn in court with attorney Abigail J. Broze.   District Attorney's Office Law Intern, Abigail Kincheloe, appeared for the State of Wisconsin.
Case called for plea and sentencing.
State places offer on the record.
Court conducts plea colloquy.

Defendant enters a guilty plea to Counts 1 & 3.  Court finds defendant guilty.
Counts 2 & 4 are Dismissed and Read in.
State and Defense make sentencing recommendations.
Defendant makes statement to the court.

Court orders the following:
COUNT 1: 
IMPOSED AND STAYED: 

3  YEARS OF IMPRISONMENT (Credit:  0  Days)
1.5   YEARS OF INITIAL CONFINEMENT
1.5   YEARS OF EXTENDED SUPERVISION

Defendant is eligible for Challenge Incarceration Program.
Defendant is eligible for Substance Abuse Program.  

Term of Probation:  3 YEARS; 
CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol, controlled substances or drug paraphernalia;
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed;
*Follow through with any assessments, evaluations, treatment and/or counseling recommended by Agent; 
*Obtain/Maintain full-time employment and/or combination of schooling;
*DNA sample to be provided if not yet previously done;
*No association with known drug users or dealers and no contact at any place where illegal drugs are purchased, used, stored, packaged, or distributed;

CONDITION TIME: 4 MONTHS in the Waukesha County Jail w/Huber (all standard release conditions, including childcare);
3 Days Credit; 
Defendant to report to Huber facility no later than 8/01/22 at 5:00 pm. 

FORFEITURE:  $2,077 to the City of Brookfield Police Department;
COSTS:  $268
DNA SAMPLE AND SURCHARGE:  $250 
Defendant to provide DNA sample, if not yet provided, immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.
To be paid as a Condition of Probation.

*Felony warnings, voting rights and firearms warnings given.

*******************************
COUNT 3: 
Court orders the following:
IMPOSED AND STAYED: 

JAIL:  6 MONTHS in the Waukesha County Jail w/Huber (all standard release conditions).
0  Days Credit.
Consecutive to Count 1 if revoked. 

Term of Probation:  1 YEAR; 
CONDITIONS OF PROBATION:  
*Same as Count 1; 
*Forfeiture of the handgun listed in the criminal complaint; 

COSTS:  $243
DNA SAMPLE AND SURCHARGE:  $200 
Defendant to provide DNA sample, if not yet provided, immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.
To be paid as a Condition of Probation.
